import React from 'react'
import { ChromePicker } from 'react-color';

export default (
    backgroundColor
) => {
    return (
        <div>
            <ChromePicker
                color={ backgroundColor }
                onChangeComplete={ this.changeColour }
            />
        </div>
    )
}
